public class SetExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Set<String> data=new LinkedHashSet<>();
		data.add("mani");
		data.add("kumar");
		data.add("raj");
		data.add("kumar");
		System.out.println(data);
	}

}
